import * as React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

export default function AnotherOne() {
  const data = [
    { name: 'W', value: 0.514 },
    { name: 'A', value: 0.697 },
    { name: 'L', value: 0.786 },
    { name: 'R', value: 0.260 },
    { name: 'R', value: 0.560 },
    { name: 'S', value: 0.262 },
    { name: 'I', value: 0.574 },
    { name: 'R', value: 0.259 },
    { name: 'R', value: 0.700 },
    { name: 'Q', value: 0.260 },
    { name: 'S', value: 0.527 },
    { name: 'Y', value: 0.828 },
  ];

  return (
    <div style={{ width: 500, height: 300 }}>
      <BarChart
        data={data}
        xAxis={{ scaleType: 'band', dataKey: 'name' }}
        series={[{ dataKey: 'value', color: '#1976d2' }]}
        width={500}
        height={300}
      />
    </div>
  );
}
